// Hàm tách riêng các từ trong một skill
function splitWords(skill) {
  // Chuyển về lowercase, loại bỏ khoảng trắng thừa, split theo space hoặc ký tự không phải chữ
  return String(skill)
    .toLowerCase()
    .trim()
    .split(/[\s\-_,]+/) // tách theo space, dash, underscore, comma
    .filter(s => s.length > 0); // loại bỏ chuỗi rỗng
}

// Parse AI Agent response
const items = $input.all();
const results = [];

for (const item of items) {
  try {
    let responseText = '';

    // AI Agent response có thể ở nhiều formats
    if (item.json.output) {
      responseText = item.json.output;
    } else if (item.json.text) {
      responseText = item.json.text;
    } else if (typeof item.json === 'string') {
      responseText = item.json;
    } else {
      throw new Error('Cannot find response text in AI Agent output');
    }

    // Clean response - remove markdown và extra text
    let cleanedText = responseText
      .replace(/```json/gi, '')
      .replace(/```/g, '')
      .replace(/^[^{]*/, '') // Remove text before {
      .replace(/[^}]*$/, '') // Remove text after }
      .trim();

    // Parse JSON
    const skills = JSON.parse(cleanedText);

    // Validate và normalize
    if (!skills.soft_skills || !Array.isArray(skills.soft_skills)) {
      throw new Error('Invalid soft_skills format');
    }
    if (!skills.hard_skills || !Array.isArray(skills.hard_skills)) {
      throw new Error('Invalid hard_skills format');
    }

    // Chuyển lowercase, trim và tách từ
    const cv_soft_skills = skills.soft_skills
      .map(s => splitWords(s))
      .flat(); // flatten mảng con thành mảng 1 chiều

    const cv_hard_skills = skills.hard_skills
      .map(s => splitWords(s))
      .flat();

    results.push({
      json: {
        cv_soft_skills,
        cv_hard_skills,
        _debug: {
          raw_response: responseText.substring(0, 200)
        }
      }
    });

  } catch (error) {
    console.error('Parse error:', error);
    results.push({
      json: {
        error: `Parse failed: ${error.message}`,
        cv_soft_skills: [],
        cv_hard_skills: [],
        _debug: {
          raw_data: JSON.stringify(item.json).substring(0, 500)
        }
      }
    });
  }
}

return results;

