const cvSoftRaw = $('Code - Parse AI Response').first().json.cv_soft_skills;
const cvSoft = Array.isArray(cvSoftRaw) ? cvSoftRaw.map(s => s.toLowerCase().trim()) : [];
const cvHardRaw = $('Code - Parse AI Response').first().json.cv_hard_skills;
const cvHard = Array.isArray(cvHardRaw) ? cvHardRaw.map(s => s.toLowerCase().trim()) : [];

// ================== Lấy dữ liệu Job từ node trước ==================
const jobData = $('Code - Prepare Job Data').first().json;
const jobSoftTokens = jobData.soft_skills_words || [];
const jobHardTokens = jobData.hard_skills_words || [];

// ================== Hàm tách từ cho CV ==================
function normalizeAndSplit(skillsArray) {
  const allWords = new Set();

  skillsArray.forEach(skill => {
    const words = skill.toLowerCase()
      .replace(/[^a-z0-9\s]/g, ' ')
      .split(/\s+/)
      .filter(word => word.length > 0);

    words.forEach(word => allWords.add(word));
  });

  return Array.from(allWords);
}

const cvSoftTokens = normalizeAndSplit(cvSoft);
const cvHardTokens = normalizeAndSplit(cvHard);

// ================== Hàm đếm số từ trùng ==================
function matchCountTokens(cvTokens, jobTokens) {
  if (!Array.isArray(cvTokens) || !Array.isArray(jobTokens)) return 0;
  const jobSet = new Set(jobTokens);
  return cvTokens.filter(token => jobSet.has(token)).length;
}

// ================== Hàm tính matching score ==================
function Scoring(cvSoftTokens, cvHardTokens, jobSoftTokens, jobHardTokens) {
  const softMatches = matchCountTokens(cvSoftTokens, jobSoftTokens);
  const hardMatches = matchCountTokens(cvHardTokens, jobHardTokens);

  const weightHard = 0.7;
  const weightSoft = 0.3;

  const rawScore = hardMatches * weightHard + softMatches * weightSoft;

  const maxHard = jobHardTokens.length || 1;
  const maxSoft = jobSoftTokens.length || 1;
  const maxScore = maxHard * weightHard + maxSoft * weightSoft;

  const scaledScore = Math.round((rawScore / maxScore) * 100);

  return scaledScore;
}

// ================== Tạo kết quả ==================
return [{
  json: {
    job_title: jobData.job_title,
    job_id: jobData.id,
    match_soft: matchCountTokens(cvSoftTokens, jobSoftTokens),
    match_hard: matchCountTokens(cvHardTokens, jobHardTokens),
    word_matching_score: Scoring(cvSoftTokens, cvHardTokens, jobSoftTokens, jobHardTokens),
    cv_soft_tokens_count: cvSoftTokens.length,
    cv_hard_tokens_count: cvHardTokens.length,
    job_soft_tokens_count: jobSoftTokens.length,
    job_hard_tokens_count: jobHardTokens.length
  }
}];

const item = $input.first();
try {
  // Lấy response từ AI Agent - Thử nhiều fields
  let responseText = item.json.output || item.json.text || item.json.response || item.json.content || '';

  // Nếu vẫn rỗng, check xem có phải data nằm trong nested object không
  if (!responseText && item.json.data) {
    responseText = typeof item.json.data === 'string' ? item.json.data : JSON.stringify(item.json.data);
  }

  // Nếu vẫn rỗng, stringify toàn bộ
  if (!responseText) {
    responseText = JSON.stringify(item.json);
  }

  // Clean response - loại bỏ markdown backticks
  let cleanedText = responseText
    .replace(/```json\n?/gi, '')
    .replace(/```\n?/g, '')
    .replace(/`/g, '')
    .trim();

  // Parse JSON
  let results = JSON.parse(cleanedText);

  // Nếu là object, wrap vào array
  if (!Array.isArray(results)) {
    results = [results];
  }

  // Map kết quả với validation
  const parsedResults = results.map((result, index) => {
    const semanticScore = typeof result.semantic_score === 'number' 
      ? Math.min(100, Math.max(0, result.semantic_score))
      : 50;

    return {
      job_title: result.job_title || `job_${index + 1}`,
      semantic_score: semanticScore,
      score: semanticScore,
      reasoning: result.reasoning || 'No reasoning provided',
      skill_gaps: Array.isArray(result.skill_gaps) ? result.skill_gaps : [],
      strengths: Array.isArray(result.strengths) ? result.strengths : []
    };
  });

  // Trả về array
  return parsedResults.map(result => ({ json: result }));

} catch (error) {
  console.error('Parse error:', error.message);
  console.error('Raw data:', JSON.stringify(item.json).substring(0, 500));

  return [{
    json: {
      job_title: 'Parse Error',
      semantic_score: 0,
      score: 0,
      reasoning: `Parse failed: ${error.message}. Raw: ${JSON.stringify(item.json).substring(0, 200)}`,
      skill_gaps: [],
      strengths: [],
      error: error.message
    }
  }];
}

